import React from 'react';

import success from '../images/success.svg';

function InfoTooltip() {
    return (
        <div className="popup popup_opened popup-info">

            <div className="popup__form">

            <img className="popup-info__img" src={success} alt="" />
            <h2 className="popup-info__title"></h2>
            </div>
        </div>
    )
}

export default InfoTooltip;
